import React from "react";
import Navbar from "./NavBar/Navbar";
import Sliding from "./Sliding/Sliding";
import Menu from "./Menu/Menu";
import Cart from "./Cart/Cart";

function Dashboard() {
  return (
    <div>
      <Navbar />
      <Sliding />
      <Menu />
      <Cart />
    </div>
  );
}

export default Dashboard;
